import Song from './Song'

const UserPlaylist = ({playlist, onDeleteSubmit}) => {


    const songlist = playlist.map(song => {
        return(
            <Song title={song.title} key={song._id} id={song._id} comment={song.comment} onDeleteSubmit={(id) => deleteById(id)}>
            </Song>
        )
    }) 

    return (
        <>
            <p>this is the playlist</p>
            <ul>
                {songlist}
            </ul>
        </>
    )


}

export default UserPlaylist;
